tsTypes.Rgba:
export type Rgba = {
    r: number;
  g: number;
  b: number;
  a: number;
};

tsTypes.WebViewAttrs:
export type WebViewAttrs = {
    user_agent: string;
  visible: boolean;
  transparent: boolean;
  background_color: Rgba;
  zoom_hotkeys_enabled: boolean;
  initialization_scripts: Array<string>;
  clipboard: boolean;
  devtools: boolean;
  accept_first_mouse: boolean;
  back_forward_navigation_gestures: boolean;
  incognito: boolean;
  autoplay: boolean;
};

tsTypes.Content:
export type Content =  { Html: {
   html: string;
} }  |
 { Url: {
   url: string;
} }  |
 { UrlAndHeaders: {
   url: string;
  headers: Array<Header>;
} };

tsTypes.FileDialogOptions:
export type FileDialogOptions = {
    location: string;
  filename: string;
  typ: FileOpenerType;
};

tsTypes.Header:
export type Header = {
    name: string;
  value: string;
};

tsTypes.Size:
export type Size = {
    height: number;
  width: number;
};

tsTypes.Img:
export type Img = {
    path: string;
  size: Size;
};

tsTypes.WindowAttrs:
export type WindowAttrs = {
    inner_size: Size;
  min_inner_size: Size;
  max_inner_size: Size;
  resizable: boolean;
  minimizable: boolean;
  maximizable: boolean;
  closable: boolean;
  title: string;
  maximized: boolean;
  visible: boolean;
  transparent: boolean;
  decorations: boolean;
  always_on_top: boolean;
  always_on_bottom: boolean;
  window_icon: Img;
  taskbar_icon: Img;
  preferred_theme: Theme;
  focused: boolean;
  content_protection: boolean;
  visible_on_all_workspaces: boolean;
};
